import { useState } from 'react';
import { BrowserRouter as Router, Route }from 'react-router-dom';
import seminima from './seminimaa.jpg'
function E1 () {
  return (
    <Router>
      <div>
        <Route path='/Leitura-de-partitura/E1' exact component={E1}>
         <img src={seminima} className="notas" alt="seminima" />
         <ul className='linha1'></ul>
         <ul className='space1'></ul>
         <ul className='linha2'></ul>
         <ul className='space2'></ul>
         <ul className='linha3'></ul>
         <ul className='space3'></ul>
         <ul className='linha4'></ul>
         <ul className='space4'></ul>
         <ul className='linha5'></ul>
         <ul className='space5'></ul>
        </Route>
      </div>
    </Router>
  );
}

export default E1;
